import React from 'react';
import {
  Box,
  Typography,
  Card,
  CardContent,
} from '@mui/material';

const Home: React.FC = () => {
  return (
    <Box>
      <Typography variant="h3" component="h1" gutterBottom>
        Welcome
      </Typography>

      {/* News Section */}
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h5" gutterBottom>
            Latest News
          </Typography>
          <Typography variant="body1" paragraph>
            [Your latest news and updates will go here]
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default Home;
